scriptlet.script:
try {
	var slist = JSON.parse(serverList);
	var serverProperties = slist[server];
	var propertyNames = Object.keys(serverProperties);

	scriptletContext.put("serverProperties",JSON.stringify(serverProperties));
	scriptletContext.put("propertyNames",JSON.stringify(propertyNames));
	scriptletResponse = "success";

}
catch(error) {
	scriptletContext.put("FailureMessage",error);
	scriptletResponse = "failure";
}

try {
	var pt = scriptletContext.get("RS_Previous_Transition");
	switch(pt) {
		case "has more":
			var xml;
			if (XML != null && XML != undefined && XML.trim() != "") {
				xml = XML;
			}
			else {
				xml = "".concat("<ServiceComponent><id>",componentId,"</id>");
			}

			if(propertyValue != null && propertyValue != undefined && propertyValue.trim() != "") {
				if(propertyName != "cloneId") {
					xml = xml.concat("<property>");
					xml = xml.concat("<name>",propertyName,"</name>");          
					xml = xml.concat("<valueType><name></name></valueType>");
					xml = xml.concat("<values><value>",propertyValue,"</value></values>");
					xml = xml.concat("<consumerVisible>true</consumerVisible>");
					xml = xml.concat("</property>");		
					scriptletResponse = "processed";
					scriptletContext.put("XML",xml);
					scriptletResult = xml;
				}
				else {
					scriptletContext.put("cloneId",propertyValue);
					scriptletResponse = "skip";
				}
			} 
			else {
				scriptletResponse = "skip";
			}
			break;
		case "no more":
			var xml = XML;
			xml = xml.concat("</ServiceComponent>");
			scriptletResponse = "completed";
			scriptletContext.put("XML",xml);
			scriptletResult = xml;
	}
}
catch(Error) {
	scriptletContext.put("FailureMessage",Error);
	sciptletResponse = "failure";
}

if(scriptletInput != undefined && scriptletInput != null && scriptletInput.trim() != "") {
	var propertyName = scriptletInput;
	var sp = JSON.parse(scriptletContext.get("serverProperties"));
	scriptletResult = sp[propertyName];
}
else {
	scriptletResult = "";
}
